<p>Die von Ihnen an uns per Kontaktanfragen uebersandten Daten verbleiben bei uns, bis Sie uns zur Loeschung auffordern, Ihre Einwilligung zur Speicherung widerrufen oder der Zweck fuer die Datenspeicherung entfaellt (z. B. nach abgeschlossener Bearbeitung Ihres Anliegens). Zwingende gesetzliche Bestimmungen  insbesondere gesetzliche Aufbewahrungsfristen  bleiben unberuehrt.</p>

